By running the CYK algorithm over the string “t29 t36 t33 t15 t38 t0”, we find:

1. Single‐token spans  
   1: {NT82, NT35}  
   2: {NT71}  
   3: {NT18}  
   4: {NT48, NT77}  
   5: {NT91}  
   6: {NT94}  

2. Building up to the full span (1–6), one eventually finds NT22 over (2–6) and NT82 at position 1, and the rule  
   S → NT82 NT22  
   covers (1–6).

Hence the start symbol S can derive the entire string.  

Yes

After filling in the length‑1 table with which NT’s generate each terminal:

 1: t15 → {NT48, NT77}  
 2: t49 → {NT15}  
 3: t39 → {NT40}  
 4: t49 → {NT15}  
 5: t6  → {NT0}  
 6: t6  → {NT0}  

and then attempting all binary splits (CKY), no pair of nonterminals matches the right‑hand side of any binary rule. Hence no higher spans can be built, and S can’t derive the entire length‑6 string.

Answer: No

To decide membership, we run the CYK algorithm over the 8‐token input t29 t36 t35 t38 t40 t21 t17 t34.  Indexing positions 1…8:

1→{NT82,NT35}  
2→{NT71}  
3→{NT36}  
4→{NT91}  
5→{NT9}  
6→{NT48}  
7→{NT74,NT58}  
8→{NT82,NT98}  

Filling in longer spans, one finds in particular:

– Span 6–7 (t21 t17) ⇒ NT12 via NT12→NT48 NT74  
– Span 5–7 (t40 t21 t17) ⇒ NT94 via NT94→NT9 NT12  
– Span 4–7 (t38 t40 t21 t17) ⇒ NT3 via NT3→NT91 NT94  
– Span 3–7 (t35 t38 t40 t21 t17) ⇒ NT48 via NT48→NT36 NT3  
– Span 2–8 (t36 t35 t38 t40 t21 t17 t34) ⇒ NT22 via NT22→NT71 NT48  
– Finally, full span 1–8 ⇒ S via S→NT82 NT22  

Since S appears in the top cell for the entire input, the string is in the language.  
Yes

To see whether S ⇒* “t10 t38 t10 t23 t49 t49 t23 t9”, we run the CYK algorithm.  First, at each position i we record which non‐terminals produce that single terminal:

pos 1 “t10”: { NT0, NT95 }  
pos 2 “t38”: { NT91 }  
pos 3 “t10”: { NT0, NT95 }  
pos 4 “t23”: { NT22 }  
pos 5 “t49”: { NT15 }  
pos 6 “t49”: { NT15 }  
pos 7 “t23”: { NT22 }  
pos 8 “t9”:  { NT18 }  

Next, for every length‑2 span we look for a rule A → B C with B in the left cell and C in the right.  Checking all 14 of the grammar’s binary productions shows that no adjacent pair of these sets ever matches any right‐hand side (e.g. (NT0, NT91), (NT15, NT22), …), so no non‐terminal can derive any length‑2 substring.  Hence no longer substrings (and in particular no length‑8 string) can be built.  S therefore cannot derive the given string.

No

By a standard CYK-fill we find these spans (showing only the non‐terminals that actually appear):

1:   t29 → {NT82, NT35}  
2:   t36 → {NT71}  
3:   t35 → {NT36}  
4:   t38 → {NT91}  
5:   t40 → {NT9}  
6:   t33 → {NT18}  
7:   t15 → {NT48, NT77}  
8:   t38 → {NT91}  
9:   t0  → {NT94}  
10:  t17 → {NT58}  
11:  t5  → {NT98, NT3, NT71, NT68}  

Then the key combinations are

Positions 6–7 (t33 t15): NT18 NT77 → NT36  
Positions 8–9 (t38 t0 ): NT91 NT94 → NT3  
Positions 6–9 (t33 t15 t38 t0 ): NT36 NT3 → NT48  
Positions 10–11 (t17 t5): NT58 NT98 → NT74  
Positions 6–11: NT48 NT74 → NT12  
Positions 5–11: NT9 NT12 → NT94  
Positions 4–11: NT91 NT94 → NT3  
Positions 3–11: NT36 NT3 → NT48  
Positions 2–11: NT71 NT48 → NT22  
Positions 1–11: NT82 NT22 → S  

Thus S ⇒* the entire string.  

Yes
